

CREATE TABLE `banner_areas` (
  `cod_arb` INTEGER(11) NOT NULL DEFAULT '0',
  `desc_arb` VARCHAR(100) COLLATE latin1_swedish_ci NOT NULL DEFAULT '',
  `largura_arb` INTEGER(11) DEFAULT NULL,
  `altura_arb` INTEGER(11) DEFAULT NULL,
  PRIMARY KEY (`cod_arb`),
  KEY `cod_arb` (`cod_arb`)

)ENGINE=MyISAM
CHARACTER SET 'latin1' COLLATE 'latin1_swedish_ci';

#
# Structure for the `banner_tipos` table : 
#

CREATE TABLE `banner_tipos` (
  `cod_tbn` INTEGER(11) NOT NULL DEFAULT '0',
  `desc_tbn` VARCHAR(50) COLLATE latin1_swedish_ci NOT NULL DEFAULT '',
  `extensoes_tbn` VARCHAR(50) COLLATE latin1_swedish_ci DEFAULT NULL,
  PRIMARY KEY (`cod_tbn`),
  KEY `cod_tbn` (`cod_tbn`)

)ENGINE=MyISAM
CHARACTER SET 'latin1' COLLATE 'latin1_swedish_ci';

#
# Structure for the `banners` table : 
#

CREATE TABLE `banners` (
  `cod_bnr` INTEGER(11) NOT NULL DEFAULT '0',
  `cod_arb` INTEGER(11) NOT NULL DEFAULT '0' COMMENT 'Código da Área',
  `titulo_bnr` VARCHAR(100) COLLATE latin1_swedish_ci DEFAULT NULL,
  `link_bnr` VARCHAR(255) COLLATE latin1_swedish_ci DEFAULT NULL,
  `arqoriginal_bnr` VARCHAR(255) COLLATE latin1_swedish_ci NOT NULL DEFAULT '',
  `arqservidor_bnr` VARCHAR(255) COLLATE latin1_swedish_ci NOT NULL DEFAULT '',
  `arqextensao_bnr` VARCHAR(5) COLLATE latin1_swedish_ci NOT NULL DEFAULT '',
  `cod_tbn` INTEGER(11) NOT NULL DEFAULT '0' COMMENT 'Código do Tipo do Banner',
  `altura_bnr` INTEGER(11) DEFAULT NULL,
  `largura_bnr` INTEGER(11) DEFAULT NULL,
  `visualizacoes_bnr` BIGINT(20) DEFAULT '0',
  `dtini_bnr` DATETIME DEFAULT NULL,
  `dtfim_bnr` DATETIME DEFAULT NULL,
  `status_stb` CHAR(1) COLLATE latin1_swedish_ci NOT NULL DEFAULT '' COMMENT 'Status do Banner',
  PRIMARY KEY (`cod_bnr`),
  KEY `cod_bnr` (`cod_bnr`)

)ENGINE=MyISAM
CHARACTER SET 'latin1' COLLATE 'latin1_swedish_ci';

#
# Structure for the `banners_status` table : 
#

CREATE TABLE `banners_status` (
  `status_stb` CHAR(1) COLLATE latin1_swedish_ci NOT NULL DEFAULT '',
  `desc_stb` VARCHAR(50) COLLATE latin1_swedish_ci NOT NULL DEFAULT '',
  PRIMARY KEY (`status_stb`),
  KEY `status_stb` (`status_stb`)

)ENGINE=MyISAM
CHARACTER SET 'latin1' COLLATE 'latin1_swedish_ci';

#
# Structure for the `cotacoes` table : 
#

CREATE TABLE `cotacoes` (
  `cod_cot` INTEGER(11) NOT NULL AUTO_INCREMENT,
  `dataAtualizacao_cot` DATE NOT NULL,
  `conteudo_cot` TEXT COLLATE latin1_swedish_ci NOT NULL,
  PRIMARY KEY (`cod_cot`)

)ENGINE=MyISAM
AUTO_INCREMENT=444 CHARACTER SET 'latin1' COLLATE 'latin1_swedish_ci';

#
# Structure for the `cotacoes_OLD` table : 
#

CREATE TABLE `cotacoes_OLD` (
  `cod_pro` INTEGER(11) NOT NULL AUTO_INCREMENT,
  `nome_pro` VARCHAR(50) COLLATE latin1_swedish_ci DEFAULT NULL,
  `preco_pro` VARCHAR(5) COLLATE latin1_swedish_ci DEFAULT NULL,
  `tipo_pro` VARCHAR(20) COLLATE latin1_swedish_ci DEFAULT NULL,
  PRIMARY KEY (`cod_pro`)

)ENGINE=MyISAM
AUTO_INCREMENT=7 CHARACTER SET 'latin1' COLLATE 'latin1_swedish_ci';

#
# Structure for the `fotos` table : 
#

CREATE TABLE `fotos` (
  `cod_fot` INTEGER(11) NOT NULL DEFAULT '0',
  `cod_gal` INTEGER(11) NOT NULL DEFAULT '0',
  `visualizacoes_fot` BIGINT(20) DEFAULT '0',
  `comentario_fot` VARCHAR(255) COLLATE latin1_swedish_ci DEFAULT NULL,
  `nomeori_fot` VARCHAR(255) COLLATE latin1_swedish_ci DEFAULT NULL,
  `nomeserv_fot` VARCHAR(255) COLLATE latin1_swedish_ci DEFAULT NULL,
  PRIMARY KEY (`cod_fot`),
  KEY `cod_fot` (`cod_fot`)

)ENGINE=MyISAM
CHARACTER SET 'latin1' COLLATE 'latin1_swedish_ci';

#
# Structure for the `fotos_galeria` table : 
#

CREATE TABLE `fotos_galeria` (
  `cod_gal` INTEGER(11) NOT NULL DEFAULT '0',
  `data_gal` DATE DEFAULT NULL,
  `titulo_gal` VARCHAR(255) COLLATE latin1_swedish_ci NOT NULL DEFAULT '',
  `desc_gal` TEXT COLLATE latin1_swedish_ci,
  `visivel_gal` CHAR(1) COLLATE latin1_swedish_ci NOT NULL DEFAULT 'N',
  `cod_emp` INTEGER(11) DEFAULT NULL,
  PRIMARY KEY (`cod_gal`),
  KEY `cod_gal` (`cod_gal`)

)ENGINE=MyISAM
CHARACTER SET 'latin1' COLLATE 'latin1_swedish_ci';

#
# Structure for the `modulos` table : 
#

CREATE TABLE `modulos` (
  `cod_mod` INTEGER(11) NOT NULL DEFAULT '0',
  `desc_mod` VARCHAR(255) COLLATE latin1_swedish_ci NOT NULL DEFAULT '',
  `link_mod` VARCHAR(255) COLLATE latin1_swedish_ci NOT NULL DEFAULT '',
  `disp_mod` CHAR(1) COLLATE latin1_swedish_ci NOT NULL DEFAULT 'S',
  `cod_gru` INTEGER(11) NOT NULL DEFAULT '1',
  PRIMARY KEY (`cod_mod`),
  KEY `cod_mod` (`cod_mod`)

)ENGINE=MyISAM
CHARACTER SET 'latin1' COLLATE 'latin1_swedish_ci';

#
# Structure for the `modulos_grupos` table : 
#

CREATE TABLE `modulos_grupos` (
  `cod_gru` INTEGER(11) NOT NULL DEFAULT '0',
  `desc_gru` VARCHAR(255) COLLATE latin1_swedish_ci NOT NULL DEFAULT '',
  PRIMARY KEY (`cod_gru`),
  KEY `cod_gru` (`cod_gru`)

)ENGINE=MyISAM
CHARACTER SET 'latin1' COLLATE 'latin1_swedish_ci';

#
# Structure for the `modulos_usuarios` table : 
#

CREATE TABLE `modulos_usuarios` (
  `login_usu` VARCHAR(255) COLLATE latin1_swedish_ci NOT NULL DEFAULT '',
  `cod_mod` INTEGER(11) NOT NULL DEFAULT '0',
  PRIMARY KEY (`login_usu`, `cod_mod`)

)ENGINE=MyISAM
CHARACTER SET 'latin1' COLLATE 'latin1_swedish_ci';

#
# Structure for the `newsletter` table : 
#

CREATE TABLE `newsletter` (
  `nome_nwl` VARCHAR(255) COLLATE latin1_swedish_ci NOT NULL DEFAULT '',
  `email_nwl` VARCHAR(255) COLLATE latin1_swedish_ci NOT NULL DEFAULT '',
  `datacad_nwl` DATETIME DEFAULT NULL,
  PRIMARY KEY (`email_nwl`)

)ENGINE=MyISAM
CHARACTER SET 'latin1' COLLATE 'latin1_swedish_ci';

#
# Structure for the `usuarios` table : 
#

CREATE TABLE `usuarios` (
  `login_usu` VARCHAR(30) COLLATE latin1_swedish_ci NOT NULL DEFAULT '',
  `senha_usu` VARCHAR(255) COLLATE latin1_swedish_ci NOT NULL DEFAULT '',
  `nome_usu` VARCHAR(255) COLLATE latin1_swedish_ci DEFAULT NULL,
  `bloquear_usu` CHAR(1) COLLATE latin1_swedish_ci NOT NULL DEFAULT 'N',
  PRIMARY KEY (`login_usu`)

)ENGINE=MyISAM
CHARACTER SET 'latin1' COLLATE 'latin1_swedish_ci';

